import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import { Drawer, IconButton, Divider, Menu } from "@material-ui/core";

export default function Navbar() {
  return (
    <Fragment>
      <nav
        className="navbar navbar-expand-md bg-primary navbar-dark fixed-top"
        style={{
          background: "linear-gradient(to left, #333399 0%, #0099c 100%)",
        }}
      >
        <IconButton
          classes={{ paper: classes.IconColor }}
          onClick={handleDrawer}
          edge="start"
          aria-label="menu"
        >
          <span className="navbar-toggler-icon"></span>
        </IconButton>
        <a href="/" className="navbar-bound">
          Arthy Umapathy
        </a>
      </nav>
    </Fragment>
  );
}
